import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { HttpClient } from '@angular/common/http';
import { Mission } from '../models/mission';


@Component({
  selector: 'app-missiondetails',
  templateUrl: './missiondetails.component.html',
  styleUrls: ['./missiondetails.component.css']
})

export class MissiondetailsComponent implements OnInit {
  mission: any;

  constructor (
    private route: ActivatedRoute,
    private httpclient: HttpClient
  ) {}

  ngOnInit(){
    const flightNumber = this.route.snapshot.paramMap.get('flight_number');
    this.mission = this.httpclient.get("https://api.spacexdata.com/v3/launches/" + flightNumber).subscribe(
      (data) => {
        this.mission = data;
        console.log(data)
      })
  }
}


<mat-card>
    <div style="font-size: large; font-weight: bold;"> SPACE X MISSION DETAILS</div>
    <img mat-card-image width="200" src={{mission.links?.mission_patch}}/>
    <mat-card-header >
        <mat-card-title>{{mission.mission_name}}</mat-card-title>
        <mat-card-subtitle>Year: {{mission.launch_year}}</mat-card-subtitle>
        <mat-card-subtitle>Flight Number: {{mission.flight_number}}</mat-card-subtitle>
    </mat-card-header>
    <mat-card-header>
        <mat-card-title>Rocket</mat-card-title>
        <mat-card-subtitle>Rocket Name: {{mission.rocket.rocket_name}}</mat-card-subtitle>
        <mat-card-subtitle>Rocket: Type{{mission.rocket.rocket_type}}</mat-card-subtitle>
    </mat-card-header>
    <mat-card-header>
        <mat-card-title>Launch Site</mat-card-title>
        <mat-card-subtitle>Rocket Name: {{mission.launchsite.site_name}}</mat-card-subtitle>
    </mat-card-header>
    <mat-card-header>
        <mat-card-title>Mission Details</mat-card-title>
        <mat-card-subtitle>Success: {{mission.launch_success}}</mat-card-subtitle>
        <mat-card-subtitle>{{mission.details}}</mat-card-subtitle>
    </mat-card-header>

</mat-card>
